import Sidebar from "./components/SideBar";
import Route from "./components/Route";

import HomePage from "./pages/HomePage";
import TestingPage from "./pages/TestingPage";
import TablePage from './pages/TablePage';

function App() {  
  return (
    <div>
    <div><Sidebar /></div>



      <Route path="testing">
        <TestingPage />
      </Route>

      <Route path="">
        <HomePage />
      </Route>
    </div>
  );
}

export default App;
